import ProgressBar from 'react-bootstrap/ProgressBar';
import {Fragment, useState} from 'react'

function BasicExample() {

    const [now, setNow] = useState(0)

    const start = () => {
        let jamanak = new Date();
        let sec = jamanak.getSeconds()
        setNow(() => {
            now = sec
        })
        console.log(sec)
    }

    return (
        <Fragment>
            <ProgressBar now={now} />
            <button
                className={"m-5"}
                onClick={start}
            >
                start!
            </button>
        </Fragment>

    );
}

export default BasicExample;
